INSERT INTO `global_settings` VALUES (1,'Daimond707','Welcome to Diamond Exchange ','0','0','0',0,'logo.png','favicon.ico','100,200,500','1000,10000,100000,150000,200000','100,200,500,1000,5000,10000,50000,1000000',0,0,'<ul><li>In valid bets will be deleted automatically or manually and there will be no claim available for such bets </li><li>In case  of any dispute , Admin has to right to take the final decision </li><li>In a cancelled/NO Result / Abondened  match all bets will be cancelled </li><li>If a  match got  cancelled due to rain, all completed fancy/session market will be settled </li><li>invalid  bets(bets with unfair rate) can be  deleted even after settling . There  will be no claim </li><li>There can be some technical issue in the software. Admin is not reponsible for such case. Play at your own risk </li><li>In case of a tied match, all completed session markets will be settled </li></ul>','0','yellow',NULL,'social_logo.png',NULL);
