DROP TABLE IF EXISTS `markets`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `markets` (
  `id` int NOT NULL AUTO_INCREMENT,
  `sport_id` varchar(150) DEFAULT NULL,
  `series_id` varchar(150) DEFAULT NULL,
  `match_id` varchar(150) DEFAULT NULL,
  `market_id` varchar(150) DEFAULT NULL,
  `name` varchar(150) DEFAULT NULL,
  `runner_json` json DEFAULT NULL,
  `max_bet_liability` double DEFAULT '0',
  `max_market_liability` double DEFAULT '0',
  `max_market_profit` double DEFAULT '0',
  `is_active` enum('1','0') DEFAULT '1',
  `is_visible` enum('1','0') DEFAULT '1',
  `is_manual` enum('1','0') DEFAULT '0',
  `is_result_declared` enum('0','1') DEFAULT '0' COMMENT '0=Not declared, 1= Result declared',
  `is_abandoned` enum('0','1') DEFAULT '0' COMMENT '0=Not Abandoned, 1=Abandoned',
  `is_manual_odds` enum('0','1') DEFAULT '0',
  `is_bookmaker_market` enum('0','1') DEFAULT '0',
  `card_data` json DEFAULT NULL,
  `create_at` bigint DEFAULT NULL,
  `update_at` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_market_match` (`match_id`,`market_id`),
  KEY `unique_index` (`market_id`),
  KEY `sport_id` (`sport_id`),
  KEY `series_id` (`series_id`),
  KEY `match_id` (`match_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11114189 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
