DROP TABLE IF EXISTS `matches`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `matches` (
  `id` int NOT NULL AUTO_INCREMENT,
  `sport_id` varchar(150) DEFAULT NULL,
  `series_id` varchar(150) DEFAULT NULL,
  `match_id` varchar(150) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `match_date` datetime DEFAULT NULL,
  `start_date` datetime DEFAULT NULL,
  `odd_limit` double DEFAULT NULL,
  `volume_limit` bigint DEFAULT NULL,
  `min_stack` double DEFAULT NULL,
  `max_stack` double DEFAULT NULL,
  `score_board_json` json DEFAULT NULL,
  `is_manual` enum('1','0') DEFAULT '0',
  `score_type` enum('1','0') DEFAULT '1' COMMENT '0=> lotus,1=>batfair',
  `score_key` varchar(100) DEFAULT '0',
  `is_completed` enum('1','0') DEFAULT '0',
  `is_active` enum('1','0') DEFAULT '1',
  `is_cup` enum('1','0') DEFAULT '0' COMMENT '0=>Normal Match, 1=>Cup ',
  `live_sport_tv_url` varchar(255) DEFAULT NULL,
  `liability_type` enum('1','0') DEFAULT '0' COMMENT '0=> normal,1=>profit',
  `is_bookmaker_market_exist` enum('1','0') DEFAULT '0',
  `create_at` bigint DEFAULT NULL,
  `update_at` bigint DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `match_id` (`match_id`),
  KEY `sport_id` (`sport_id`),
  KEY `series_id` (`series_id`),
  KEY `is_active` (`is_active`),
  KEY `is_cup` (`is_cup`)
) ENGINE=InnoDB AUTO_INCREMENT=184 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
