CREATE DEFINER=`betting`@`%` FUNCTION `fn_update_balance_liability`(
	`pMarketId` VARCHAR(100),
	`pUserId` INT,
	`pLiabilityType` VARCHAR(100)
) RETURNS tinyint
    NO SQL
    COMMENT 'For update balance by liability and liability, accordingly liability plus/minus. When add liability then pLiabilityType=add, else pLiabilityType=sub. If userwise then pass pUserId else pUserId is 0'
BEGIN



    IF(pLiabilityType = 'add') THEN



      IF(pUserId != 0) THEN

      UPDATE users a

      INNER JOIN 

        (
          SELECT sum(
            CASE WHEN (m.liability_type="1" and aa.liability_type="1") 
            then -(aa.stack)  else 0 end 
          )   AS liability_total_stack, aa.user_id ,m.liability_type,

          CASE WHEN (aa.liability_type="0") 
          then min(aa.win_value + aa.loss_value) 
          else 0 end AS liability_min_value
          
          FROM odds_profit_loss aa 
          INNER JOIN matches m on m.match_id=aa.match_id
          WHERE aa.market_id = pMarketId AND aa.user_id = pUserId

          GROUP BY aa.user_id

          
           HAVING CASE  WHEN m.liability_type=1 then 1 else (liability_min_value+liability_total_stack) < 0 end 

        ) b ON (a.id=b.user_id)

      SET a.balance = a.balance + (b.liability_min_value+b.liability_total_stack),

      a.liability = a.liability + (b.liability_min_value+b.liability_total_stack); 

    ELSE

      UPDATE users a

      INNER JOIN 

        (
          SELECT sum(
            CASE WHEN (m.liability_type="1" and aa.liability_type="1") 
            then -(aa.stack)  else 0 end 
          )   AS liability_total_stack, aa.user_id ,m.liability_type,

          CASE WHEN (aa.liability_type="0") 
          then min(aa.win_value + aa.loss_value) 
          else 0 end AS liability_min_value


          FROM odds_profit_loss aa 
          INNER JOIN matches m on m.match_id=aa.match_id
          WHERE aa.market_id = pMarketId

          GROUP BY aa.user_id

          
           HAVING CASE  WHEN m.liability_type=1 then 1 else (liability_min_value+liability_total_stack) < 0 end 

        ) b ON (a.id=b.user_id)

      SET a.balance = a.balance + (b.liability_min_value+b.liability_total_stack),

      a.liability = a.liability + (b.liability_min_value+b.liability_total_stack); 

    END IF;



  ELSE

    IF(pUserId != 0) THEN

      UPDATE users a

      INNER JOIN 

        (
          SELECT sum(
            CASE WHEN (m.liability_type="1" and aa.liability_type="1") 
            then -(aa.stack)  else 0 end 
          )   AS liability_total_stack, aa.user_id ,m.liability_type,

          CASE WHEN (aa.liability_type="0") 
          then min(aa.win_value + aa.loss_value) 
          else 0 end AS liability_min_value
          FROM odds_profit_loss aa 
          INNER JOIN matches m on m.match_id=aa.match_id
          WHERE aa.market_id = pMarketId AND aa.user_id = pUserId

          GROUP BY aa.user_id

          
           HAVING CASE  WHEN m.liability_type=1 then 1 else (liability_min_value+liability_total_stack) < 0 end 

        ) b ON (a.id=b.user_id)

      SET a.balance = a.balance - (b.liability_min_value+b.liability_total_stack),

      a.liability = a.liability - (b.liability_min_value+b.liability_total_stack);

    ELSE

      UPDATE users a

      INNER JOIN 

        (
          
          SELECT sum(
            CASE WHEN (m.liability_type="1" and aa.liability_type="1") 
            then -(aa.stack)  else 0 end 
          )   AS liability_total_stack, aa.user_id ,m.liability_type,

          CASE WHEN (aa.liability_type="0") 
          then min(aa.win_value + aa.loss_value) 
          else 0 end AS liability_min_value


          FROM odds_profit_loss aa 
          INNER JOIN matches m on m.match_id=aa.match_id
          WHERE aa.market_id = pMarketId

          GROUP BY aa.user_id

          
           HAVING CASE  WHEN m.liability_type=1 then 1 else (liability_min_value+liability_total_stack) < 0 end 

        ) b ON (a.id=b.user_id)

      SET a.balance = a.balance - (b.liability_min_value+b.liability_total_stack),

      a.liability = a.liability - (b.liability_min_value+b.liability_total_stack); 

    END IF;



  END IF;



  RETURN TRUE;

  

END ;;
