CREATE DEFINER=`betting`@`%` PROCEDURE `sp_abandoned_fancy`(
  IN `pFancyId` VARCHAR(50)






,
  IN `pIsRollback` TINYINT



)
BEGIN 
DECLARE fancyStatus VARCHAR(50);
DECLARE resultV INT;
DECLARE retMess TEXT;
DECLARE LID INTEGER;
DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN 
SET resultV = -1;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);
ROLLBACK;

SELECT resultV, retMess;

END;

DECLARE EXIT HANDLER FOR SQLWARNING BEGIN 

SET resultV = -2;

GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 

@errno = MYSQL_ERRNO, 

@text = MESSAGE_TEXT;

SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);

ROLLBACK;

SELECT resultV, retMess;

END;

START TRANSACTION;

  IF (pIsRollback = 0) THEN

    SET fancyStatus = (SELECT active FROM fancy WHERE fancy_id = pFancyId AND active IN('0', '1') LIMIT 1);

    IF (fancyStatus IS NOT NULL) THEN

      INSERT INTO bet_results (sport_id, match_id, market_id, type, selection_id, result, created_at, winner_name) SELECT sport_id, match_id, fancy_id, '2', 'Abandoned', 'Abandoned', UNIX_TIMESTAMP(), 'Abandoned' FROM fancy WHERE fancy_id = pFancyId;

      SET LID = LAST_INSERT_ID();


      UPDATE users AS a 
      inner join fancy_score_position f on  f.user_id=a.id
      SET a.balance = a.balance - f.liability ,a.liability = a.liability - f.liability 
      WHERE f.fancy_id = pFancyId; 

      UPDATE bets_fancy SET delete_status = '3', deleted_reason = 'Abandoned', bet_result_id = LID WHERE fancy_id = pFancyId AND delete_status = '0'; 

      UPDATE fancy SET active = '3', display_message = 'Abandoned' WHERE fancy_id = pFancyId;

      SET resultV = 1;
      SET retMess = 'Fancy abandoned successfully';

    ELSE

      SET resultV = 0;
      SET retMess = 'Fancy already closed or abandoned !';

    END IF;

  ELSE

    SET fancyStatus = (SELECT active FROM fancy WHERE fancy_id = pFancyId AND active = '3' LIMIT 1);

    IF (fancyStatus IS NOT NULL) THEN


       UPDATE users AS a 
      inner join fancy_score_position f on  f.user_id=a.id
      SET a.balance = a.balance + f.liability ,a.liability = a.liability + f.liability 
      WHERE f.fancy_id = pFancyId; 

      UPDATE bets_fancy SET delete_status = '0', deleted_reason = NULL, bet_result_id = NULL WHERE fancy_id = pFancyId AND delete_status = '3'; 

      UPDATE fancy SET active = '0', display_message = NULL WHERE fancy_id = pFancyId;

      DELETE FROM bet_results WHERE market_id = pFancyId AND type = '2';

      SET resultV = 1;
      SET retMess = 'Fancy rollback successfully';

    ELSE

      SET resultV = 0;
      SET retMess = 'Fancy not abandoned already !';

    END IF;

  END IF; 

COMMIT;

SELECT resultV, retMess;

END ;;
DELIMITER ;
