CREATE DEFINER=`betting`@`%` PROCEDURE `sp_abandoned_market`(
  IN `pMatchId` INT,
  IN `pMarketId` VARCHAR(100),
  IN `pIsRollback` TINYINT










)
BEGIN 
DECLARE resultV INT;
DECLARE retMess TEXT;
DECLARE LID INTEGER;
DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN 

SET resultV = -1;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );
ROLLBACK;
SELECT resultV, retMess;
END;

DECLARE EXIT HANDLER FOR SQLWARNING BEGIN 
SET resultV = -2;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );

ROLLBACK;
SELECT resultV, retMess;
END;

START TRANSACTION;

  IF (pIsRollback = 0) THEN

    SET @checkData = (SELECT id FROM markets WHERE match_id = pMatchId AND market_id = pMarketId AND is_result_declared = '0' LIMIT 1);

    IF (@checkData IS NOT NULL) THEN 

      INSERT INTO bet_results (sport_id, match_id, market_id, type, selection_id, result, created_at, winner_name) SELECT sport_id, match_id, market_id, '1', 'Abandoned', 'Abandoned', UNIX_TIMESTAMP(), 'Abandoned' FROM markets WHERE match_id = pMatchId AND market_id = pMarketId;

      SET LID = LAST_INSERT_ID();

      UPDATE users AS a INNER JOIN (SELECT c.user_id, sum( CASE WHEN (m.liability_type="1" and c.liability_type="1")  then -(c.stack)  else 0 end  )   AS liability_total_stack, CASE WHEN (c.liability_type="0")  then min(c.win_value + c.loss_value)  else 0 end AS liability_min_value ,m.liability_type FROM odds_profit_loss AS c INNER JOIN matches m on m.match_id=c.match_id WHERE c.match_id = pMatchId AND c.market_id = pMarketId GROUP BY c.user_id having CASE  WHEN m.liability_type=1 then 1 else (liability_total_stack+liability_min_value) < 0 end) AS b ON (a.id = b.user_id) SET a.balance = a.balance - (b.liability_total_stack+b.liability_min_value), a.liability = a.liability - (b.liability_total_stack+b.liability_min_value);
      UPDATE bets_odds SET result = -1, bet_result_id = LID, winner_name = 'Abandoned' WHERE match_id = pMatchId AND market_id = pMarketId;
      UPDATE markets SET is_active = '0', is_result_declared = '1', is_abandoned = '1' WHERE match_id = pMatchId AND market_id = pMarketId LIMIT 1;

      SET resultV = 1;
      SET retMess = 'Match abandoned successfully';
    ELSE
      SET resultV = -1;
      SET retMess = 'Result already decleared !';
    END IF;

  ELSE
    SET @checkData = (SELECT id FROM markets WHERE match_id = pMatchId AND market_id = pMarketId AND is_result_declared = '1' and is_abandoned = '1' LIMIT 1);

    IF (@checkData IS NOT NULL) THEN 
      UPDATE users AS a INNER JOIN (SELECT c.user_id, sum( CASE WHEN (m.liability_type="1" and c.liability_type="1")  then -(c.stack)  else 0 end  )   AS liability_total_stack, CASE WHEN (c.liability_type="0")  then min(c.win_value + c.loss_value)  else 0 end AS liability_min_value ,m.liability_type FROM odds_profit_loss AS c INNER JOIN matches m on m.match_id=c.match_id WHERE c.match_id = pMatchId AND c.market_id = pMarketId GROUP BY c.user_id having CASE  WHEN m.liability_type=1 then 1 else (liability_total_stack+liability_min_value) < 0 end ) AS b ON (a.id = b.user_id) SET a.balance = a.balance + (b.liability_total_stack+b.liability_min_value), a.liability = a.liability + (b.liability_total_stack+b.liability_min_value);
      UPDATE bets_odds SET result = NULL, bet_result_id = NULL, winner_name = NULL WHERE match_id = pMatchId AND market_id = pMarketId;
      UPDATE markets SET is_active = '1', is_result_declared = '0', is_abandoned = '0' WHERE match_id = pMatchId AND market_id = pMarketId LIMIT 1;

      DELETE FROM bet_results WHERE market_id = pMarketId AND type = '1';

      SET resultV = 1;
      SET retMess = 'Match rollback successfully';
    ELSE
      SET resultV = -1;
      SET retMess = 'Match not abandoned already !';
    END IF;

  END IF; 

COMMIT;

SELECT resultV, retMess;

END ;;
