CREATE DEFINER=`betting`@`%` PROCEDURE `sp_delete_odds_bet`(
  IN `pBetId` INT ,
  IN `pUserId` INT,
  IN `pMarketId` VARCHAR(100),
  IN `pIsVoid` TINYINT ,
  IN `pRemoteIp` VARCHAR(50)

)
BEGIN 
DECLARE resultV INT;
DECLARE newLiability DECIMAL(10,2);
DECLARE oldLiability DECIMAL(10,2);
DECLARE stackLibility DECIMAL(10,2);

DECLARE retMess TEXT;
DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN 

SET resultV = -1;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );
ROLLBACK;
SELECT resultV, retMess;
END;

DECLARE EXIT HANDLER FOR SQLWARNING BEGIN 
SET resultV = -2;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );

ROLLBACK;
SELECT resultV, retMess;
END;

START TRANSACTION;

  SET @checkBet = (SELECT delete_status FROM bets_odds WHERE id = pBetId AND delete_status != '1' AND bet_result_id IS NULL LIMIT 1);
  
  IF (@checkBet IS NOT NULL) THEN 
  
    IF (@checkBet = '0') THEN 

        IF(pIsVoid = 1) THEN 
          UPDATE bets_odds SET delete_status = '2', deleted_reason = 'Bet void by admin', deleted_by = 1, deleted_from_ip = pRemoteIp WHERE id = pBetId LIMIT 1;
          SET retMess = 'Bet void successfully';
        ELSE
          UPDATE bets_odds SET delete_status = '1', deleted_reason = 'Bet deleted by admin', deleted_by = 1, deleted_from_ip = pRemoteIp WHERE id = pBetId LIMIT 1;
          SET retMess = 'Bet deleted successfully';
        END IF;

        SET @liability_type = (SELECT m.liability_type FROM bets_odds b inner join matches m on m.match_id=b.match_id  WHERE b.id = pBetId  LIMIT 1);

        IF(@liability_type = 1) THEN 
           SET @res = fn_save_odds_profit_loss(pUserId, pMarketId); 
           SET @stackLibility  = (SELECT -k.stack FROM bets_odds k  WHERE k.id = pBetId  LIMIT 1 );
           UPDATE users a SET a.balance = a.balance - (@stackLibility), a.liability = a.liability - (@stackLibility) WHERE  a.id=pUserId;
        ELSE
           set oldLiability = (select ifnull((case when (min(win_value+loss_value)>0) then 0 else min(win_value+loss_value) end),0)  as win_loss from odds_profit_loss where market_id= pMarketId and user_id= pUserId );

          SET @res = fn_save_odds_profit_loss(pUserId, pMarketId);

           set newLiability =  (select ifnull((case when (min(win_value+loss_value)>0) then 0 else min(win_value+loss_value) end),0)  as win_loss from odds_profit_loss where market_id= pMarketId and user_id= pUserId );
              
           UPDATE users a SET a.balance = a.balance - (abs(newLiability)-abs(oldLiability)), a.liability = a.liability - (abs(newLiability)-abs(oldLiability)) WHERE  a.id=pUserId;
        END IF;

        
    ELSE

        UPDATE bets_odds SET delete_status = '1', deleted_reason = 'Bet deleted by admin', deleted_by = 1, deleted_from_ip = pRemoteIp WHERE id = pBetId LIMIT 1;
      SET retMess = 'Bet void successfully';
    END IF;
    
    
    SET resultV = 1;
    
  ELSE
    SET resultV = -1;
    SET retMess = 'Result already decleared or bet deleted !';
  END IF;

COMMIT;

SELECT resultV, retMess;

END ;;
