CREATE DEFINER=`betting`@`%` PROCEDURE `sp_get_bet_history`(
	IN `pUserID` INT,
	IN `pUserType` INT,
	IN `pFromDate` VARCHAR(50),
	IN `pToDate` VARCHAR(50),
	IN `qoffset` INT,
	IN `qlimit` INT,
	IN `pBetType` CHAR(1) ,
	IN `pIsDownload` INT,
	IN `pSportId` VARCHAR(50),
	IN `pSearch` VARCHAR(255),
	OUT `out_total` INT 
 




)
BEGIN
  DECLARE pBetsDateConditions varchar(255) default '';
  DECLARE pSessionDateConditions varchar(255) default '';
  DECLARE finalQuery TEXT default '';
  DECLARE sumQuery TEXT default '';
  DECLARE pBetTypeCond varchar(255) default '';
  DECLARE pUserOddsConditions varchar(255) default '';
  DECLARE pUserSessionConditions varchar(255) default '';
  DECLARE calcCheck varchar(50) default '';
  DECLARE pagingQry varchar(100) default '';
  DECLARE pSportQueryForOdd varchar(255) default '';
  DECLARE pSportQueryForFancy varchar(255) default '';
  DECLARE pSearchQuery varchar(255) default '';
 
  IF(qoffset = 0 && pIsDownload != 1) THEN
    SET calcCheck = ' SQL_CALC_FOUND_ROWS ';
  END IF;
 
  IF(pIsDownload != 1) THEN
    SET pagingQry = CONCAT(" LIMIT ", qoffset , " , " , qlimit) ;
  END IF;
 
  IF pSportId != "" THEN    
  SET pSportQueryForOdd = CONCAT(" AND bets_odds.sport_id =", pSportId );
    SET pSportQueryForFancy = CONCAT(" AND bets_fancy.sport_id =", pSportId );
  ELSE
    SET pSportQueryForOdd =  '';
    SET pSportQueryForFancy =  '';
  END IF;
 
  IF pSearch != "" THEN    
  SET pSearchQuery = CONCAT(" AND (users.name LIKE '%", pSearch,"%' OR users.user_name LIKE '%",pSearch,"%')" );
  ELSE
    SET pSearchQuery =  '';
  END IF;
 
  IF pToDate != 0 AND pFromDate != 0 THEN
    SET pBetsDateConditions = CONCAT(" AND DATE(FROM_UNIXTIME(bets_odds.created_at+19800)) >= (date('",pFromDate,"'))  AND DATE(FROM_UNIXTIME(bets_odds.created_at+19800)) <= (date('",pToDate,"'))  ");
    SET pSessionDateConditions = CONCAT(" AND DATE(FROM_UNIXTIME(bets_fancy.created_at+19800)) >= (date('",pFromDate,"')) AND DATE(FROM_UNIXTIME(bets_fancy.created_at+19800)) <= (date('",pToDate,"')) ");
  ELSE
    SET pBetsDateConditions =  '';
    SET pSessionDateConditions =  '';
  END IF;
 
  IF pUserType = 1 THEN
    SET pUserOddsConditions = CONCAT(" AND bets_odds.admin_id =", pUserID );
    SET pUserSessionConditions = CONCAT(" AND bets_fancy.admin_id =", pUserID );
  ELSEIF pUserType = 2 THEN
    SET pUserOddsConditions = CONCAT(" AND bets_odds.master_id =", pUserID );
    SET pUserSessionConditions = CONCAT(" AND bets_fancy.master_id =", pUserID );
  ELSEIF pUserType = 3 THEN
    SET pUserOddsConditions = CONCAT(" AND bets_odds.super_agent_id =", pUserID );
    SET pUserSessionConditions = CONCAT(" AND bets_fancy.super_agent_id =", pUserID );
  ELSEIF pUserType = 4 THEN
    SET pUserOddsConditions = CONCAT(" AND bets_odds.agent_id =", pUserID );
    SET pUserSessionConditions = CONCAT(" AND bets_fancy.agent_id =", pUserID );
  ELSEIF pUserType = 5 THEN
    SET pUserOddsConditions = CONCAT(" AND bets_odds.user_id =", pUserID );
  SET pUserSessionConditions = CONCAT(" AND bets_fancy.user_id =", pUserID );
  ELSEIF pUserType = 0 THEN
    SET pUserOddsConditions = '';
    SET pUserSessionConditions = '';
  END IF;
 
  IF pBetType = 'M' THEN
    SET @finalQuery = CONCAT(
        "SELECT ", calcCheck, " * FROM (SELECT users.name, users.user_name, agent.name AS agent_name, agent.user_name AS agent_user_name, super_agent.name AS super_agent_name, super_agent.user_name AS super_agent_user_name, master.name AS master_name, master.user_name AS master_user_name, admin.name AS admin_name, admin.user_name AS admin_user_name, 'Odds' AS bet_type,bets_odds.created_at placed,matches.name match_name,bets_odds.selection_name,markets.name market_name,bets_odds.id bet_id,bets_odds.bet_matched_at,bets_odds.is_back,bets_odds.odds,bets_odds.stack,bets_odds.sport_id,sports.name AS sport_name,
    CASE WHEN (bets_odds.delete_status = '2') THEN
          0
        ELSE
          bets_odds.liability
        END AS liability,
 
        CASE WHEN (bets_odds.delete_status = '2') THEN
          0
        ELSE
          bets_odds.p_l
        END AS potential_profit,
 
        bets_odds.delete_status,bets_odds.ip_address
      FROM bets_odds 
      INNER JOIN users ON bets_odds.user_id = users.id
      LEFT JOIN users AS agent ON bets_odds.agent_id = agent.id
      LEFT JOIN users AS super_agent ON bets_odds.super_agent_id = super_agent.id
      LEFT JOIN users AS master ON bets_odds.master_id = master.id
      LEFT JOIN users AS admin ON bets_odds.admin_id = admin.id
      LEFT JOIN sports ON bets_odds.sport_id = sports.sport_id
      LEFT JOIN matches ON bets_odds.match_id = matches.match_id
      LEFT JOIN markets ON bets_odds.market_id = markets.market_id AND bets_odds.match_id = markets.match_id
      WHERE bets_odds.is_matched = 1 AND bets_odds.bet_result_id IS NULL AND bets_odds.delete_status != '1' ", pUserOddsConditions , pBetsDateConditions ,pSportQueryForOdd,pSearchQuery, "  
            UNION ALL
            SELECT users.name, users.user_name, agent.name AS agent_name, agent.user_name AS agent_user_name, super_agent.name AS super_agent_name, super_agent.user_name AS super_agent_user_name, master.name AS master_name, master.user_name AS master_user_name, admin.name AS admin_name, admin.user_name AS admin_user_name, 'Fancy' AS bet_type, bets_fancy.created_at placed,matches.name match_name,CONCAT(bets_fancy.fancy_name ,' ( ', bets_fancy.size ,  ' ) ' ) selection_name,'' market_name,bets_fancy.id bet_id,'' bet_matched_at,bets_fancy.is_back ,bets_fancy.run odds,bets_fancy.stack,bets_fancy.sport_id,sports.name AS sport_name, 
 
              CASE WHEN (bets_fancy.delete_status = '2') THEN
                0
              ELSE
                bets_fancy.liability
              END AS liability,
 
              CASE WHEN (bets_fancy.delete_status = '2') THEN
                0
              ELSE
                bets_fancy.profit
              END AS potential_profit,
 
            bets_fancy.delete_status,bets_fancy.ip_address
      FROM bets_fancy
      INNER JOIN users ON bets_fancy.user_id = users.id
      LEFT JOIN users AS agent ON bets_fancy.agent_id = agent.id
      LEFT JOIN users AS super_agent ON bets_fancy.super_agent_id = super_agent.id
      LEFT JOIN users AS master ON bets_fancy.master_id = master.id
      LEFT JOIN users AS admin ON bets_fancy.admin_id = admin.id
      LEFT JOIN sports ON bets_fancy.sport_id = sports.sport_id
      LEFT JOIN matches ON bets_fancy.match_id = matches.match_id
      WHERE bets_fancy.bet_result_id IS NULL AND bets_fancy.delete_status != '1' ", pUserSessionConditions , pSessionDateConditions , pSportQueryForFancy , pSearchQuery ,"  
            ) bets ORDER BY bets.placed DESC ", pagingQry);
  ELSEIF pBetType = 'U' THEN
  SET @finalQuery = CONCAT(
        "SELECT ", calcCheck, " users.name, users.user_name, agent.name AS agent_name, agent.user_name AS agent_user_name, super_agent.name AS super_agent_name, super_agent.user_name AS super_agent_user_name, master.name AS master_name, master.user_name AS master_user_name, 'Odds' AS bet_type, bets_odds.created_at placed,matches.name match_name,bets_odds.selection_name,markets.name market_name,bets_odds.id bet_id,bets_odds.bet_matched_at,bets_odds.is_back,bets_odds.odds,bets_odds.stack,bets_odds.sport_id,sports.name AS sport_name,
 
          CASE WHEN (bets_odds.delete_status = '2') THEN
            0
          ELSE
            bets_odds.liability
          END AS liability,
 
          CASE WHEN (bets_odds.delete_status = '2') THEN
            0
          ELSE
            bets_odds.p_l
          END AS potential_profit,
 
        bets_odds.delete_status,bets_odds.ip_address
      FROM bets_odds
      INNER JOIN users ON bets_odds.user_id = users.id
      LEFT JOIN users AS agent ON bets_odds.agent_id = agent.id
      LEFT JOIN users AS super_agent ON bets_odds.super_agent_id = super_agent.id
      LEFT JOIN users AS master ON bets_odds.master_id = master.id
      LEFT JOIN sports ON bets_odds.sport_id = sports.sport_id
      LEFT JOIN matches ON bets_odds.match_id = matches.match_id
      LEFT JOIN markets ON bets_odds.market_id = markets.market_id AND bets_odds.match_id = markets.match_id
      WHERE bets_odds.is_matched = '0' AND bets_odds.bet_result_id IS NULL AND bets_odds.delete_status != '1' ", pUserOddsConditions , pBetsDateConditions , pSportQueryForOdd , pSearchQuery , "  ORDER BY bets_odds.created_at DESC ", pagingQry);
  ELSE
    SET @finalQuery = CONCAT(
        "SELECT ", calcCheck, " * FROM (SELECT users.name, users.user_name, agent.name AS agent_name, agent.user_name AS agent_user_name, super_agent.name AS super_agent_name, super_agent.user_name AS super_agent_user_name, master.name AS master_name, master.user_name AS master_user_name, 'Odds' AS bet_type, bet_results.created_at settled, bets_odds.created_at placed,matches.name match_name,bets_odds.selection_name,markets.name market_name,bets_odds.id bet_id,bets_odds.bet_matched_at,bets_odds.is_back,bets_odds.odds,bets_odds.stack,bets_odds.sport_id,sports.name AS sport_name,
 
          CASE WHEN (bets_odds.delete_status = '2') THEN
            0
          ELSE
            bets_odds.liability
          END AS liability,
 
          CASE WHEN (bets_odds.delete_status = '2') THEN
            0
          ELSE
            bets_odds.chips
          END AS profit_loss,
 
          CASE WHEN (bets_odds.result = -1) THEN
            'ABANDONED'
          WHEN (bets_odds.delete_status = '2') THEN
            'VOID'
          ELSE
            CASE WHEN bets_odds.chips < 0 THEN 'LOST' ELSE 'WON' END 
          END AS status, bets_odds.delete_status, bets_odds.ip_address, bet_results.selection_id, bets_odds.match_id, bets_odds.market_id, 
          CASE WHEN (bets_odds.result = -1) THEN 'ABANDONED' ELSE bets_odds.winner_name END AS bet_result
      FROM bets_odds 
      INNER JOIN users ON bets_odds.user_id = users.id
      LEFT JOIN users AS agent ON bets_odds.agent_id = agent.id
      LEFT JOIN users AS super_agent ON bets_odds.super_agent_id = super_agent.id
      LEFT JOIN users AS master ON bets_odds.master_id = master.id
      LEFT JOIN sports ON bets_odds.sport_id = sports.sport_id
      LEFT JOIN matches ON bets_odds.match_id = matches.match_id
      LEFT JOIN markets ON bets_odds.market_id = markets.market_id AND bets_odds.match_id = markets.match_id
      LEFT JOIN bet_results ON bet_results.type = '1' AND bets_odds.bet_result_id = bet_results.id
      WHERE bets_odds.bet_result_id IS NOT NULL AND bets_odds.delete_status != '1' ", pUserOddsConditions , pBetsDateConditions , pSportQueryForOdd , pSearchQuery ," 
            UNION ALL
            SELECT users.name, users.user_name, agent.name AS agent_name, agent.user_name AS agent_user_name, super_agent.name AS super_agent_name, super_agent.user_name AS super_agent_user_name, master.name AS master_name, master.user_name AS master_user_name, 'Fancy' AS bet_type, bet_results.created_at settled,bets_fancy.created_at placed,matches.name match_name,CONCAT(bets_fancy.fancy_name ,' ( ', bets_fancy.size ,  ' ) ' ) selection_name,'' market_name,bets_fancy.id bet_id,'' bet_matched_at,bets_fancy.is_back,bets_fancy.run odds,bets_fancy.stack,bets_fancy.sport_id,sports.name AS sport_name,
 
            CASE WHEN (bets_fancy.delete_status = '2') THEN
              0
            ELSE
              bets_fancy.liability
            END AS liability,
 
            CASE WHEN (bets_fancy.delete_status = '2') THEN
              0
            ELSE
              bets_fancy.chips
            END AS profit_loss,
 
            CASE WHEN (bets_fancy.delete_status = '3') THEN
              'ABANDONED'
            WHEN (bets_fancy.delete_status = '2') THEN
              'VOID'
            ELSE
              CASE WHEN bets_fancy.chips < 0 THEN 'LOST' ELSE 'WON' END 
            END AS status, bets_fancy.delete_status, bets_fancy.ip_address, bets_fancy.fancy_id AS selection_id, bets_fancy.match_id, bets_fancy.fancy_id AS market_id, (CASE WHEN (bets_fancy.delete_status = '3') THEN 'ABANDONED' ELSE fancy.result END) AS bet_result
      FROM bets_fancy 
      INNER JOIN fancy on (bets_fancy.fancy_id = fancy.fancy_id)
      INNER JOIN users ON bets_fancy.user_id = users.id
      LEFT JOIN users AS agent ON bets_fancy.agent_id = agent.id
      LEFT JOIN users AS super_agent ON bets_fancy.super_agent_id = super_agent.id
      LEFT JOIN users AS master ON bets_fancy.master_id = master.id
      LEFT JOIN sports ON bets_fancy.sport_id = sports.sport_id
      LEFT JOIN matches ON bets_fancy.match_id = matches.match_id
      LEFT JOIN bet_results ON bet_results.type = '2' AND bets_fancy.bet_result_id = bet_results.id
      WHERE (bets_fancy.bet_result_id IS NOT NULL OR bets_fancy.delete_status = '3') AND bets_fancy.delete_status != '1' ", pUserSessionConditions , pSessionDateConditions , pSportQueryForFancy , pSearchQuery,"  
            ) bets ORDER BY bets.placed DESC ", pagingQry); 
  END IF;
 
  PREPARE stmt FROM @finalQuery;
  EXECUTE stmt;
  DEALLOCATE PREPARE stmt;
 
  IF(qoffset = 0 || pIsDownload = 1) THEN
    SET out_total = FOUND_ROWS();
 
    IF pBetType = 'M' THEN
      SET @sumQuery = CONCAT(
          "SELECT IFNULL(SUM(bets.liability), 0) AS total_liability,
           IFNULL(SUM(bets.potential_profit), 0) AS total_potential_profit FROM (
           SELECT bets_odds.liability, bets_odds.p_l potential_profit FROM bets_odds INNER JOIN users ON bets_odds.user_id = users.id WHERE bets_odds.is_matched = 1 AND bets_odds.bet_result_id IS NULL AND bets_odds.delete_status = '0' ", pUserOddsConditions , pBetsDateConditions , pSportQueryForOdd , pSearchQuery , "  
              UNION ALL
              SELECT bets_fancy.liability,bets_fancy.profit potential_profit FROM bets_fancy INNER JOIN users ON bets_fancy.user_id = users.id WHERE bets_fancy.bet_result_id IS NULL AND bets_fancy.delete_status = '0' ", pUserSessionConditions , pSessionDateConditions ,pSportQueryForFancy , pSearchQuery ,"  
              ) bets");
    ELSEIF pBetType = 'U' THEN
    SET @sumQuery = CONCAT(
          "SELECT IFNULL(SUM(bets_odds.liability), 0) AS total_liability, IFNULL(SUM(bets_odds.p_l), 0) AS total_potential_profit 
          FROM bets_odds
          INNER JOIN users ON bets_odds.user_id = users.id
          WHERE bets_odds.is_matched = '0' AND bets_odds.bet_result_id IS NULL AND bets_odds.delete_status = '0' ", pUserOddsConditions , pBetsDateConditions , pSportQueryForOdd ,pSearchQuery);
    ELSE
      SET @sumQuery = CONCAT(
          "SELECT IFNULL(SUM(bets.liability), 0) AS total_liability, IFNULL(SUM(bets.profit_loss), 0) AS total_potential_profit FROM (
            SELECT bets_odds.liability,bets_odds.chips profit_loss FROM bets_odds INNER JOIN users ON bets_odds.user_id = users.id WHERE bets_odds.bet_result_id IS NOT NULL AND bets_odds.delete_status = '0' ", pUserOddsConditions , pBetsDateConditions , pSportQueryForOdd,pSearchQuery,"  
            UNION ALL
            SELECT bets_fancy.liability,bets_fancy.chips profit_loss FROM bets_fancy INNER JOIN users ON bets_fancy.user_id = users.id WHERE (bets_fancy.bet_result_id IS NOT NULL OR bets_fancy.delete_status = '3') AND bets_fancy.delete_status = '0' ", pUserSessionConditions , pSessionDateConditions , pSportQueryForFancy,pSearchQuery,"
          ) bets"); 
    END IF;
 
    PREPARE stmt FROM @sumQuery;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
 
  END IF;
    
 
END ;;
