CREATE DEFINER=`betting`@`%` PROCEDURE `sp_remove_data_datewise`(
  IN `pFromDate` DATE,
  IN `pToDate` DATE

























)
BEGIN 
DECLARE matchIds TEXT;
DECLARE resultV INT;
DECLARE retMess TEXT;
DECLARE isValidDate INT;

DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN 

SET resultV = -1;

GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );

ROLLBACK;
SELECT resultV, retMess;
END;

DECLARE EXIT HANDLER FOR SQLWARNING BEGIN 

SET resultV = -2;

GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;

SET retMess = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );

ROLLBACK;
SELECT resultV, retMess;
END;


START TRANSACTION;

SET isValidDate = (SELECT COUNT(*) AS total WHERE pFromDate <= DATE(DATE_SUB(NOW(), INTERVAL 10 DAY)) AND pToDate <= DATE(DATE_SUB(NOW(), INTERVAL 10 DAY)));

IF (isValidDate > 0) THEN

  SET @qry = CONCAT("DELETE FROM bets_odds WHERE DATE(FROM_UNIXTIME(created_at)) >= '", pFromDate, "' AND DATE(FROM_UNIXTIME(created_at)) <= '", pToDate, "' AND (bet_result_id IS NOT NULL OR delete_status != '0');");
  PREPARE STMT FROM @qry;
  EXECUTE STMT;
  DEALLOCATE PREPARE STMT; 

  SET @qry = CONCAT("DELETE FROM bets_fancy WHERE DATE(FROM_UNIXTIME(created_at)) >= '", pFromDate, "' AND DATE(FROM_UNIXTIME(created_at)) <= '", pToDate, "' AND (bet_result_id IS NOT NULL OR delete_status != '0');");
  PREPARE STMT FROM @qry;
  EXECUTE STMT;
  DEALLOCATE PREPARE STMT; 

  SET resultV = 1;
  SET retMess = 'Data cleared successfully';

ELSE
  SET resultV = -1;
  SET retMess = 'Dates should be 10 days prior to current date';
END IF;

COMMIT;

SELECT resultV, retMess;

END ;;
