CREATE DEFINER=`betting`@`%` PROCEDURE `sp_set_result_fancy`(
  IN `pSportsID` VARCHAR(50),
  IN `pMatchID` VARCHAR(50),
  IN `pFancyID` VARCHAR(50),
  IN `pResult` VARCHAR(500),
  IN `pSportsNM` VARCHAR(500),
  IN `pMatchNM` VARCHAR(500),
  IN `pSuperAdminCommissionType` INT,
  IN `pIsSessionCommissionToAdmin` INT
)
BEGIN DECLARE LID INTEGER;
DECLARE iReturn INT;
DECLARE sMsg VARCHAR(500);
DECLARE pIsSuperAdminCommission CHAR(1);
DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN 
SET 
  iReturn = -1;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;
SET 
  sMsg = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );
ROLLBACK;
SELECT 
  iReturn, 
  sMsg;
END;
DECLARE EXIT HANDLER FOR SQLWARNING BEGIN 
SET 
  iReturn = -1;
GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
@errno = MYSQL_ERRNO, 
@text = MESSAGE_TEXT;
SET 
  sMsg = CONCAT(
    "ERROR ", @errno, " (", @sqlstate, 
    "): ", @text
  );
ROLLBACK;
SELECT 
  iReturn, 
  sMsg;
END;


MainLabel : BEGIN IF (
  SELECT 
    result 
  FROM 
    bet_results 
  WHERE 
    sport_id = pSportsID 
    AND match_id = pMatchID 
    AND market_id = pFancyID 
    AND type = '2'
) IS NOT NULL THEN 
SET 
  iReturn = 3;
SET 
  sMsg = 'Already Saved ...';
SELECT 
  iReturn, 
  sMsg;
LEAVE MainLabel;
END IF;

START TRANSACTION;

SET pIsSuperAdminCommission = (SELECT is_super_admin_commission FROM sports WHERE sport_id = pSportsID LIMIT 1);

INSERT INTO bet_results (sport_id, match_id, market_id, type, selection_id, result, created_at, winner_name) 
VALUES (pSportsID, pMatchID, pFancyID, '2', pFancyID, pResult, UNIX_TIMESTAMP(), pResult);

SET 
  LID = LAST_INSERT_ID();

UPDATE fancy SET result = pResult, active = '2', display_message = 'Close Fancy' WHERE match_id = pMatchID AND fancy_id = pFancyID;

UPDATE 
  bets_fancy 
SET 
  bet_result_id = LID, 
  chips = profit
WHERE match_id = pMatchID AND fancy_id = pFancyID AND type_id = 2 AND ((is_back = '1' AND run <= pResult) OR (is_back = '0' AND run > pResult));

UPDATE 
  bets_fancy 
SET 
  bet_result_id = LID, 
  chips =  liability
WHERE match_id = pMatchID AND fancy_id = pFancyID AND type_id = 2 AND ((is_back = '1' AND run > pResult) OR(is_back = '0' AND run <= pResult));


INSERT INTO user_profit_loss (
  user_id, agent_id, super_agent_id, master_id, admin_id, sport_id, match_id, market_id, type, bet_result_id, stack, description, reffered_name, created_at, user_pl, agent_pl, super_agent_pl, master_pl, admin_pl, user_commission, agent_commission, super_agent_commission, master_commission, admin_commission, super_admin_commission_user_part, super_admin_commission_agent_part, super_admin_commission_super_agent_part, super_admin_commission_master_part, super_admin_commission_admin_part, super_admin_commission
) 
SELECT 
  a.user_id, a.agent_id, a.super_agent_id, a.master_id, a.admin_id, a.sport_id, a.match_id, a.fancy_id, '2', LID, SUM(a.stack) AS total_stack, 
  CONCAT('PnL Fancy->', pSportsNM, '->', pMatchNM, '->', fancy_name, '->Result(', pResult, ')') AS description,
  CONCAT(pSportsNM, '->', pMatchNM, '->', fancy_name) AS reffered_name, 
  UNIX_TIMESTAMP() AS created_at,
  SUM(a.chips) user_pl,

  SUM(CASE WHEN (a.chips) < 0 THEN 
    ABS(((a.chips * a.agent) / 100)) 
  ELSE 
    -(ABS(((a.chips * a.agent) / 100))) 
  END) AS agent_pl,

  SUM(CASE WHEN (a.chips) < 0 THEN 
    ABS(((a.chips * a.super_agent) / 100)) 
  ELSE 
    -(ABS(((a.chips * a.super_agent) / 100))) 
  END) AS super_agent_pl,

  SUM(CASE WHEN (a.chips) < 0 THEN 
    ABS(((a.chips * a.master) / 100)) 
  ELSE 
    -(ABS(((a.chips * a.master) / 100))) 
  END) AS master_pl,

  SUM(CASE WHEN (a.chips) < 0 THEN 
    ABS(((a.chips * a.admin) / 100)) 
  ELSE 
    -(ABS(((a.chips * a.admin) / 100))) 
  END) AS admin_pl,

  (CASE WHEN pIsSessionCommissionToAdmin = '1' THEN 
    CASE WHEN (SUM(a.chips) > 0) THEN 
      -(ABS((ABS(SUM(a.chips)) * a.user_commission) / 100))
    ELSE
      0
    END
  ELSE
    (ABS((ABS(SUM(a.stack)) * a.user_commission) / 100))
  END) AS user_commission_val,

  (CASE WHEN pIsSessionCommissionToAdmin = '1' THEN 
    CASE WHEN (SUM(a.chips) > 0) THEN 
      ((ABS((ABS(SUM(a.chips)) * a.user_commission) / 100) *  a.agent) / 100)
    ELSE
      0
    END
  ELSE
    -((ABS((ABS(SUM(a.stack)) * a.user_commission) / 100) *  a.agent) / 100)
  END) AS agent_commission_val,

  (CASE WHEN pIsSessionCommissionToAdmin = '1' THEN 
    CASE WHEN (SUM(a.chips) > 0) THEN 
      ((ABS((ABS(SUM(a.chips)) * a.user_commission) / 100) *  a.super_agent) / 100)
    ELSE
      0
    END
  ELSE
    -((ABS((ABS(SUM(a.stack)) * a.user_commission) / 100) *  a.super_agent) / 100)
  END) AS super_agent_commission_val,

  (CASE WHEN pIsSessionCommissionToAdmin = '1' THEN 
    CASE WHEN (SUM(a.chips) > 0) THEN 
      ((ABS((ABS(SUM(a.chips)) * a.user_commission) / 100) *  a.master) / 100)
    ELSE
      0
    END
  ELSE
    -((ABS((ABS(SUM(a.stack)) * a.user_commission) / 100) *  a.master) / 100)
  END) AS master_commission_val,

  (CASE WHEN pIsSessionCommissionToAdmin = '1' THEN 
    CASE WHEN (SUM(a.chips) > 0) THEN 
      ((ABS((ABS(SUM(a.chips)) * a.user_commission) / 100) *  a.admin) / 100)
    ELSE
      0
    END
  ELSE
    -((ABS((ABS(SUM(a.stack)) * a.user_commission) / 100) *  a.admin) / 100)
  END) AS admin_commission_val,

  (CASE WHEN pIsSuperAdminCommission = '1' THEN
    CASE WHEN (pSuperAdminCommissionType = 1 AND SUM(a.chips) > 0) THEN
      -((SUM(a.chips) * a.super_admin_commission_user_part) / 100)
      
    WHEN (pSuperAdminCommissionType = 2 AND SUM(a.chips) < 0) THEN
      0
    WHEN (pSuperAdminCommissionType = 3) THEN
      0
    WHEN (pSuperAdminCommissionType = 4) THEN
      0
    ELSE
      0
    END 
  ELSE
    0
  END) AS super_admin_commission_user_part,

  (CASE WHEN pIsSuperAdminCommission = '1' THEN
    CASE WHEN (pSuperAdminCommissionType = 1 AND SUM(a.chips) > 0) THEN
      ((SUM(a.chips) * a.super_admin_commission_user_part) / 100)
      -
      ((SUM(a.chips) * a.super_admin_commission_agent_part) / 100)

    WHEN (pSuperAdminCommissionType = 2 AND SUM(a.chips) < 0) THEN
      -((ABS(SUM(a.chips)) * a.super_admin_commission_agent_part) / 100)

    WHEN (pSuperAdminCommissionType = 3) THEN
      0
    WHEN (pSuperAdminCommissionType = 4) THEN
      -((((SUM(a.stack) * a.super_admin_commission_admin_part) / 100) * agent) / 100)

    ELSE
      0
    END 
  ELSE
    0
  END) AS super_admin_commission_agent_part,

  (CASE WHEN pIsSuperAdminCommission = '1' THEN
    CASE WHEN (pSuperAdminCommissionType = 1 AND SUM(a.chips) > 0) THEN
      ((SUM(a.chips) * a.super_admin_commission_agent_part) / 100)
      -
      ((SUM(a.chips) * a.super_admin_commission_super_agent_part) / 100)

    WHEN (pSuperAdminCommissionType = 2 AND SUM(a.chips) < 0) THEN
      ((ABS(SUM(a.chips)) * a.super_admin_commission_agent_part) / 100)
      -
      ((ABS(SUM(a.chips)) * a.super_admin_commission_super_agent_part) / 100)

    WHEN (pSuperAdminCommissionType = 3) THEN
      0
    WHEN (pSuperAdminCommissionType = 4) THEN
      -((((SUM(a.stack) * a.super_admin_commission_admin_part) / 100) * super_agent) / 100)

    ELSE
      0
    END 
  ELSE
    0
  END) AS super_admin_commission_super_agent_part,

  (CASE WHEN pIsSuperAdminCommission = '1' THEN
    CASE WHEN (pSuperAdminCommissionType = 1 AND SUM(a.chips) > 0) THEN
      ((SUM(a.chips) * a.super_admin_commission_super_agent_part) / 100)
      -
      ((SUM(a.chips) * a.super_admin_commission_master_part) / 100)

    WHEN (pSuperAdminCommissionType = 2 AND SUM(a.chips) < 0) THEN
      ((ABS(SUM(a.chips)) * a.super_admin_commission_super_agent_part) / 100)
      -
      ((ABS(SUM(a.chips)) * a.super_admin_commission_master_part) / 100)

    WHEN (pSuperAdminCommissionType = 3) THEN
      0
    WHEN (pSuperAdminCommissionType = 4) THEN
      -((((SUM(a.stack) * a.super_admin_commission_admin_part) / 100) * master) / 100)

    ELSE
      0
    END 
  ELSE
    0
  END) AS super_admin_commission_master_part,

  (CASE WHEN pIsSuperAdminCommission = '1' THEN
    CASE WHEN (pSuperAdminCommissionType = 1 AND SUM(a.chips) > 0) THEN
      ((SUM(a.chips) * a.super_admin_commission_master_part) / 100)
      -
      ((SUM(a.chips) * a.super_admin_commission_admin_part) / 100)

    WHEN (pSuperAdminCommissionType = 2 AND SUM(a.chips) < 0) THEN
      ((ABS(SUM(a.chips)) * a.super_admin_commission_master_part) / 100)
      -
      ((ABS(SUM(a.chips)) * a.super_admin_commission_admin_part) / 100)

    WHEN (pSuperAdminCommissionType = 3) THEN
      -(CASE WHEN (SUM(a.chips) > 0) THEN
        (((ABS(SUM(a.chips)) - ((ABS((ABS(SUM(a.stack)) * a.user_commission) / 100) * a.admin) / 100)) * a.super_admin_commission_admin_part) / 100)
      ELSE
        0
      END)
    
    WHEN (pSuperAdminCommissionType = 4) THEN
      -((((SUM(a.stack) * a.super_admin_commission_admin_part) / 100) * admin) / 100)

    ELSE
      0
    END 
  ELSE
    0
  END) AS super_admin_commission_admin_part,

  (CASE WHEN pIsSuperAdminCommission = '1' THEN
    CASE WHEN (pSuperAdminCommissionType = 1 AND SUM(a.chips) > 0) THEN
      ((SUM(a.chips) * a.super_admin_commission_admin_part) / 100)

    WHEN (pSuperAdminCommissionType = 2 AND SUM(a.chips) < 0) THEN
      ((ABS(SUM(a.chips)) * a.super_admin_commission_admin_part) / 100)

    WHEN (pSuperAdminCommissionType = 3) THEN
      (CASE WHEN (SUM(a.chips) > 0) THEN
        (((ABS(SUM(a.chips)) - ((ABS((ABS(SUM(a.stack)) * a.user_commission) / 100) * a.admin) / 100)) * a.super_admin_commission_admin_part) / 100)
      ELSE
        0
      END)

    WHEN (pSuperAdminCommissionType = 4) THEN
      (SUM(a.stack) * a.super_admin_commission_admin_part) / 100

    ELSE
      0
    END 
  ELSE
    0
  END) AS super_admin_commission




FROM 
  bets_fancy a
WHERE
  a.match_id = pMatchID 
  AND a.fancy_id = pFancyID 
  AND a.delete_status = '0' 
GROUP BY 
  a.user_id;

SET @res = fn_update_balance_on_result(LID, '1', '0', pIsSuperAdminCommission, pSuperAdminCommissionType);

COMMIT;
SET 
  iReturn = 0;
SET 
  sMsg = 'Saved Successfully ...';
SELECT 
  iReturn, 
  sMsg;
END;
END ;;
