CREATE DEFINER=`betting`@`%` PROCEDURE `sp_set_result_odds_per_selection`(
	IN `pSportsID` VARCHAR(50),
	IN `pMatchID` VARCHAR(50),
	IN `pMarketID` VARCHAR(100),
	IN `pSelectionID` VARCHAR(50),
	IN `pOdds` DECIMAL(10,4),
	IN `pIsWinner` INT
)
BEGIN 
DECLARE LID INTEGER;
DECLARE resultV INT;
DECLARE retMess VARCHAR(500);
DECLARE EXIT HANDLER FOR SQLEXCEPTION BEGIN 

SET resultV = -1;
  GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
  @errno = MYSQL_ERRNO, 
  @text = MESSAGE_TEXT;

SET retMess = CONCAT( "ERROR ", @errno, " (", @sqlstate,  "): ", @text );

ROLLBACK;

SELECT resultV, retMess;

END;

DECLARE EXIT HANDLER FOR SQLWARNING BEGIN 

SET resultV = -2;
  GET STACKED DIAGNOSTICS CONDITION 1 @sqlstate = RETURNED_SQLSTATE, 
  @errno = MYSQL_ERRNO, 
  @text = MESSAGE_TEXT;

SET retMess = CONCAT("ERROR ", @errno, " (", @sqlstate, "): ", @text);

ROLLBACK;

SELECT resultV, retMess;

END;

MainLabel : BEGIN IF (
  SELECT result FROM bet_results 
  WHERE sport_id = pSportsID AND match_id = pMatchID AND market_id = pMarketID AND selection_id =pSelectionID
  ) IS NOT NULL THEN 

SET resultV = 3;
SET retMess = 'Already Saved ...';

SELECT resultV, retMess;
LEAVE MainLabel;

END IF;

START TRANSACTION;

UPDATE bets_odds 
SET 
  result = 1, 
  odds = CASE WHEN (pOdds = 0 or pOdds < 0) THEN odds ELSE pOdds+1 END ,
  p_l = CASE 
          WHEN pOdds = 0 THEN p_l ELSE case when pOdds < 0   then (pOdds*-1)*stack else pOdds*stack end

        END ,
  chips =   CASE 
              WHEN  pIsWinner=1 THEN   
                CASE WHEN is_back = '0' THEN liability ELSE p_l END
              WHEN  pIsWinner=2 THEN   
                CASE WHEN is_back = '0' THEN (liability/2) ELSE -(stack/2) END  
            ELSE 
                CASE WHEN is_back = '0' THEN stack ELSE - stack END
            END
WHERE 
  is_matched = '1' 
  AND match_id = pMatchID 
  AND market_id = pMarketID 
  AND selection_id = pSelectionID;

COMMIT;

SET resultV = 0;
SET retMess = 'Saved Successfully ...';
SELECT resultV, retMess;

END;

